class MessageParser {
    constructor(actionProvider, state) {
        this.actionProvider = actionProvider;
        this.state = state;
    }

    parse(message) {
        // Log the latest message content
        console.log("Latest Message:", message);

        // Log all previous messages
        const allPreviousMessages = this.state.messages.map(msg => msg);
        console.log("All Previous Messages:", allPreviousMessages);
    }
}

export default MessageParser;
